import React from 'react'
import styled from 'styled-components'

const Container  =  styled.div`
    height: 60px;
`
const Wrapper = styled.div `
    padding: 10px 20px;
    display: flex;
    justify-content: space-between;
`

const Left = styled.div`
width: 33.3%;
`

const Center = styled.div`
width: 33.3%;`
const Right = styled.div``

const Navbar = () => {
    return (
        <Container>
           <Wrapper>
               <Left>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Veritatis, eveniet qui cum quasi molestiae accusamus non alias expedita in facilis assumenda quia ipsum velit magni adipisci placeat autem doloribus quibusdam.</Left>
               <Center>center</Center>
               <Right>right</Right>
           </Wrapper> 
        </Container>
    )
}

export default Navbar
